Aspose.PDF for SharePoint 1.0.0
Download&nbsp;
Support Forum&nbsp;
File Details
Downloads: 38 File Size: 2.5 MB Posted By: codewarior Views: 310 Date Added: 10/14/2011
.downloadcount {
background-image: url("/images/loading.svg");
background-repeat: no-repeat;
background-size: 21px;
background-position: -2px 10px;
color: transparent;
}
$.getJSON("https:\/\/releases.admin.aspose.com/api/updatecount?path=7ad554b8bb5b48d8890b650c5afa78aa&single=1", function(data) { $.each(data, function(key, value) {
$("#dwn-update-"+ key).css({"background":"none"});
$("#dwn-update-"+ key).css({"color":"#333"});
$("#dwn-update-"+ key).text(value.download_count);
$("#added-update-"+ key).text(value.date_added);
});
});

